  render() {
    const { handleOk, handleCancel, visible } = this
    return (
      <div>
        <Modal
          title="Edit Profile"
          visible={visible}
          onOk={handleOk}
          onCancel={handleCancel}
        >
          <p>Some contents...</p>
          <p>Some contents...</p>
          <p>Some contents...</p>
        </Modal>
      </div>
    )
  }
}
